Twoje efekty wywołujące obrażenia Cienia z upływem czasu mają {c_number}[{SF_0}*100|%x|]{/c} szans na zadanie dodatkowo {c_number}[{SF_1}*100|%x|]{/c} obrażeń za każdym razem, gdy wywołują obrażenia. Szansa ta wzrasta o {c_number}[{SF_2}*100|%x|]{/c}, a premia do obrażeń o {c_number}[{SF_3}*100|%x|]{/c} za każde posiadane przez ciebie {c_number}[{SF_4}]{/c} pkt. inteligencji.

Obecne szanse: {c_number}[SF_6 * 100|%|]{/c}
Obecna premia: {c_number}[SF_5 * 100|%x|]{/c}
